    "text" : "5 \u0BB5\u0BAF\u0B9A\u0BC1\u0BB2 \u0B87\u0BB0\u0BC1\u0BA8\u0BCD\u0BA4\u0BC1 \u0B95\u0BB2\u0BC8\u0B9E\u0BB0\u0BC8 \u0BA8\u0BC7\u0BB0\u0BCD\u0BB2 \u0BAA\u0BBE\u0BB0\u0BCD\u0BA4\u0BCD\u0BA4\u0BC1\u0B9F\u0BCD\u0B9F\u0BC1 \u0B87\u0BB0\u0BC1\u0B95\u0BCD\u0B95\u0BC1\u0BAE\u0BCD. \u0B8E\u0BAA\u0BCD\u0BAA\u0BCB \u0BB5\u0BA3\u0B95\u0BCD\u0B95\u0BAE\u0BCD \u0BAA\u0BA3\u0BCD\u0BA3\u0BBE\u0BB2\u0BC1\u0BAE\u0BCD \u0BA4\u0BBF\u0BB0\u0BC1\u0BAE\u0BCD\u0BAA \u0BB5\u0BA3\u0B95\u0BCD\u0B95\u0BAE\u0BCD \u0BAA\u0BA3\u0BCD\u0BA3\u0BC1\u0BB5\u0BBE\u0BB0\u0BCD. \u0B87\u0BB1\u0BC1\u0BA4\u0BBF\u0BAF\u0BBE\u0B95 \u0B87\u0BA8\u0BCD\u0BA4 \u0B9C\u0BC2\u0BB2\u0BC8 \u0BAE\u0BBE\u0BA4 \u0BA4\u0BCA\u0B9F\u0B95\u0BCD\u0B95\u0BA4\u0BCD\u0BA4\u0BBF\u0BB2\u0BC1\u0BAE\u0BCD \u0B95\u0BCB\u0BAA\u0BBE\u0BB2\u0BAA\u0BC1\u0BB0\u0BA4\u0BCD\u0BA4\u0BBF\u0BB2\u0BCD \u0BAA\u0BBE\u0BB0\u0BCD\u0BA4\u0BCD\u0BA4\u0BC7\u0BA9\u0BCD. \u0B87\u0BA8\u0BCD\u0BA4 \u0BAE\u0BC1\u0BB1\u0BC8 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BBE\u0BA4 \u0BA8\u0BBF\u0BB2\u0BC8\u0BAF\u0BBF\u0BB2\u0BC1\u0BAE\u0BCD \u0BAA\u0BA4\u0BBF\u0BB2\u0BCD \u0BB5\u0BA3\u0B95\u0BCD\u0B95\u0BA4\u0BCD\u0BA4\u0BC1\u0B95\u0BCD\u0B95\u0BBE\u0B95 \u0B95\u0BC8\u0BAF\u0BC8 \u0B85\u0B9A\u0BC8\u0BA4\u0BCD\u0BA4\u0BBE\u0BB0\u0BCD. \u0B9A\u0BC1\u0BAF\u0BAE\u0BB0\u0BBF\u0BAF\u0BA4\u0BC8\u0BA4\u0BBE\u0BA9\u0BCD \u0B85\u0BB5\u0BB0\u0BCD \u0BAE\u0BC2\u0B9A\u0BCD\u0B9A\u0BC1. \u0BAE\u0BBF\u0BB8\u0BCD \u0BAF\u0BC2 \u0BA4\u0BBE\u0BA4\u0BCD\u0BA4\u0BBE. https:\/\/t.co\/bbCFHtSTbt",
