  "text" : "RT @prakashjaya7479: \u0B8E\u0BB5\u0BA3\u0BCD\u0B9F\u0BBE \u0B9C\u0BBE\u0BA9\u0B95\u0BBF\u0B95\u0BCD\u0B95\u0BC1 \u0BAE\u0BC6\u0BB0\u0BBF\u0BA9\u0BBE\u0BB5\u0BBF\u0BB2\u0BCD \u0B87\u0B9F\u0BAE\u0BCD \u0B95\u0BCA\u0B9F\u0BC1\u0B95\u0BCD\u0B95 \u0BA4\u0BBF.\u0BAE\u0BC1.\u0B95. \u0BAE\u0BB1\u0BC1\u0BA4\u0BCD\u0BA4\u0BA4\u0BC1 \u0B8E\u0BA9\u0BCD\u0BB1\u0BC1 \u0B9A\u0BCA\u0BA9\u0BCD\u0BA9\u0BA4\u0BC1..? \u0BAE\u0BC1\u0B9F\u0BCD\u0B9F\u0BBE\u0BAA\u0BAF\u0BB2\u0BC1\u0B99\u0BCD\u0B95\u0BB3\u0BBE \u0B9C\u0BBE\u0BA9\u0B95\u0BBF \u0B87\u0BB1\u0BA8\u0BCD\u0BA4\u0BA4\u0BC1 1996 \u0BAE\u0BC7 19.\u2026",
