  "text" : "RT @iParisal: \u0BAE\u0BB0\u0BA3\u0BBF\u0BA4\u0BCD\u0BA4 \u0BAA\u0BBF\u0BB1\u0B95\u0BC1, \u0B92\u0BB0\u0BC1\u0BB5\u0BB0\u0BCD \u0BA8\u0BC0\u0BA4\u0BBF\u0BAE\u0BA9\u0BCD\u0BB1\u0BA4\u0BCD\u0BA4\u0BBE\u0BB2\u0BCD \u0B95\u0BC1\u0BB1\u0BCD\u0BB1\u0BB5\u0BBE\u0BB3\u0BBF \u0B8E\u0BA9 \u0B85\u0BB1\u0BBF\u0BB5\u0BBF\u0B95\u0BCD\u0B95\u0BAA\u0BCD\u0BAA\u0B9F\u0BCD\u0B9F\u0BBE\u0BB0\u0BCD. \u0B87\u0BA9\u0BCD\u0BA9\u0BCA\u0BB0\u0BC1\u0BB5\u0BB0\u0BCD, \u0BA8\u0BC0\u0BA4\u0BBF\u0BAE\u0BA9\u0BCD\u0BB1\u0BA4\u0BCD\u0BA4\u0BBE\u0BB2\u0BCD \u0BA4\u0B95\u0BC1\u0BA4\u0BBF \u0BB5\u0BBE\u0BAF\u0BCD\u0BA8\u0BCD\u0BA4\u0BB5\u0BB0\u0BCD \u0B8E\u0BA9\u0BCD\u0BB1\u0BC1 \u0BA8\u0BC0\u0BB3\u0BBE\u0BA4\u0BCD\u2026",
